import { AppRoute } from '../../const';


function App(): JSX.Element {
  return(
    <Routes>
      <Route path={AppRoute.Index}>

      </Route> 
      <Route path={AppRoute.Guitar} element={<GuitarPage />} />
    </Routes>
  );
}

export default App;
